import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

const Header = () => {
  return (
    <div>
      <Link to="/">Contact</Link>
      <div>
        <span>Logout</span>
        <Link to="/">Profile</Link>
      </div>
    </div>
  );
};

export default Header;
